  let largeText = ""
  let smallImage = ""
  let smallText = ""

  async function updateDiscordRPC() {
    try {
      const rpcData = {
        application_id: applicationId,
        state,
        details,
        large_image: largeImage,
        large_text: largeText,
        small_image: smallImage,
        small_text: smallText
      };
      await invoke("update_discord_rpc", {rpcData});
    } catch (error) {
      console.log(error);
    }
  }
</script>
